import React, { useState } from "react";
import './App.css';
import Attribute from "./components/Attribute";

function App() {
    const [attributes, setAttributes] = useState(0);

    const attributeChildren = [];
    for (let i = 0; i < attributes; i += 1) {
        attributeChildren.push(<Attribute key={i} number={i} />);
    }

    return (
        <React.Fragment>
            <div className="App">
                <h1>Upload Form</h1>
                <form>
                    <div className="form-group">
                        <label htmlFor="Name">Name</label>
                        <input type="text" className="form-control" id="Name"/>
                        <label htmlFor="Beschreibung">Beschreibung</label>
                        <input type="text" className="form-control" id="Beschreibung"/>
                        <label htmlFor="Preis">Name</label>
                        <input type="text" className="form-control" id="Preis"/>
                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleFormControlSelect1">Example select</label>
                        <button type="button" className="btn btn-dark" onClick={() => setAttributes(attributes + 1)}>+</button>
                        {attributeChildren}
                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleFormControlSelect2">Example multiple select</label>
                        <select multiple className="form-control" id="exampleFormControlSelect2">
                            <option>1</option>
                            <option>2</option>
                            <option>3</option>
                            <option>4</option>
                            <option>5</option>
                        </select>
                    </div>
                    <div className="form-group">
                        <label htmlFor="exampleFormControlTextarea1">Example textarea</label>
                        <textarea className="form-control" id="exampleFormControlTextarea1" rows="3"></textarea>
                    </div>
                </form>
            </div>
        </React.Fragment>
    );
}

export default App;
